;(function(){
    var img = new Image();
    var textures = ["data:image/png;base64\,", "data:image/png;base64,", "data:image/png;base64\,", "data:image/png;base64\,", "data:image/png;base64\,", "data:image/png;base64\,", "data:image/png;base64\,"];
    img.src = textures[0];


    var ps;
    var dirCtrl = new PE.CircleAdjust({
        min: 0,
        max: 30,
        rotation: -30,
        value: 5,
        angleRange: 360,
        change: function (value, angle) {
            ps.angle=angle;
            ps.speed=value;
        },
        renderTo: document.getElementById("emitAngleCtrl")

    });


    var rangeCtrl = new PE.RectAdjust({
        min: 0,
        max: 360,
        value: 360,
        fillStyle: "black",
        change: function (value) {
            ps.angleRange=value;
            dirCtrl.setRange(value);
        },
        renderTo: document.getElementById("rangeCtrl")
    });


    var redCtrl = new PE.RectAdjust({
        min: 0,
        max: 1,
        value: 0.8,
        fillStyle: "red",
        change: function (value) {
            ps.changeFilter([redCtrl.value, greenCtrl.value, blueCtrl.value, alphaCtrl.value]);
        },
        renderTo: document.getElementById("rCtrl")
    });

    var greenCtrl = new PE.RectAdjust({
        min: 0,
        max: 1,
        value: 0.2,
        fillStyle: "green",
        change: function (value) {
            ps.changeFilter([redCtrl.value, greenCtrl.value, blueCtrl.value, alphaCtrl.value]);
        },
        renderTo: document.getElementById("gCtrl")
    });

    var blueCtrl = new PE.RectAdjust({
        min: 0,
        max: 1,
        value: 0.8,
        fillStyle: "blue",
        change: function (value) {
            ps.changeFilter([redCtrl.value, greenCtrl.value, blueCtrl.value, alphaCtrl.value]);
        },
        renderTo: document.getElementById("bCtrl")
    });

    var alphaCtrl = new PE.RectAdjust({
        min: 0,
        max: 1,
        value: 1,
        fillStyle: "black",
        change: function (value) {
            ps.changeFilter([redCtrl.value, greenCtrl.value, blueCtrl.value, alphaCtrl.value]);
        },
        renderTo: document.getElementById("aCtrl")
    });


    var widthCtrl = new PE.RectAdjust({
        min: 0,
        max: 100,
        value: 1,
        fillStyle: "black",
        change: function (value) {
            ps.emitArea[0]=value;
        },
        renderTo: document.getElementById("widthCtrl")
    });

    var heightCtrl = new PE.RectAdjust({
        min: 0,
        max: 100,
        value: 1,
        fillStyle: "black",
        change: function (value) {
            ps.emitArea[1] = value;
        },
        renderTo: document.getElementById("heightCtrl")
    });

    new PE.CircleAdjust({
        min: 0,
        max: 1,
        rotation: 90,
        value: 0.1,
        change: function (value, angle) {
            ps.gravity=new PE.Vector2(value * Math.cos(angle * Math.PI / 180), value * Math.sin(angle * Math.PI / 180));

        },
        renderTo: document.getElementById("gravityCtrl")

    });

    var scaleCtrl = new PE.RectAdjust({
        min: 0,
        max: 3,
        value: 1,
        fillStyle: "black",
        change: function (value) {
            ps.scaleX = ps.scaleY = value;
        },
        renderTo: document.getElementById("scaleCtrl")
    });

    var emitFQ = new PE.RectAdjust({
        min: 1,
        max: 15,
        value: 1,
        fillStyle: "black",
        change: function (value) {
            ps.emitCount = Math.floor(value);
        },
        renderTo: document.getElementById("emitFQ")
    });


    img.onload = function () {
        var stage = new ARE.Stage("#ourCanvas",true);
 
        ps = new ARE.ParticleSystem({
            emitX: 200,
            emitY: 200,
            speed: 4,
            angle: 0,
            angleRange: 360,
            emitArea: [1, 1],  
            texture: "data:image/png;base64\,",
            filter: [0.8, 0.2, 0.8, 1],
            emitCount: 1,
            maxCount: 2000
        });

        
        // ps.container.scaleX = ps.container.scaleY = 1;
        stage.add(ps);
        //stage.debug = true;
        //stage.on("mousemove", function (evt) {
        //    ps.emitX = evt.stageX;
        //    ps.emitY = evt.stageY;
        //})
    
   

        var ttSlt = document.getElementById("ttSlt");
        ttSlt.onchange = function () {

            var index = ttSlt.selectedIndex; // 选中索引
            var value = ttSlt.options[index].value; // 选中值
            
            img.onload = function () {
                ps.texture = img;
            }
            img.src = textures[value];
         
        }

        img.onload = null;


        

        var  dBtn = document.getElementById("downloadOption"), optTextarea = document.getElementById("optTextarea"), closeBtn = document.getElementById("closeBtn"), popup = document.getElementById("popup");
     
      

        closeBtn.onclick = function () {
            popup.style.display = "none";
        }

        var dom = {};
        dom.byId = function (id) {
            return document.getElementById(id);
        }
        var target = dom.byId("drop-target");

        var render = function (src) {
        
            var newImg = new Image();
            newImg.onload = function () {
                ps.texture = newImg;
            };
            textures.push(src);
            newImg.src = src;
        };

        var readImage = function (imgFile) {
            if (!imgFile.type.match(/image.*/)) {
                console.log("The dropped file is not an image: ", imgFile.type);
                return;
            }

            var reader = new FileReader();
            reader.onload = function (e) {
                render(e.target.result);
            };
            reader.readAsDataURL(imgFile);
        };

        //	DOMReady setup
        target.addEventListener("dragover", function (e) { e.preventDefault(); }, true);
        target.addEventListener("drop", function (e) {
            e.preventDefault();
            readImage(e.dataTransfer.files[0]);
        }, true);

        //ps.maxCount = 0;
        setTimeout(function () {
            ps.maxCount = 0;
        }, 500);
        var canRecord = false;
        var loop = setInterval(function () {
            ps.maxCount = 200;
            if (beginRecord) {
                canRecord = true;
            } else {
                canRecord = false;
            }
            setTimeout(function () {
                ps.maxCount = 0;
                //if (beginRecord) {
                //    setTimeout(function () {
                //        beginRecord = false;
                //        canRecord = false;
                //    }, 500)
                //}
            }, 500);
        }, 4000);
   


        var beginRecord = false,preTime=new Date(),currentTime=new Date(),orderID=0,frameCount=0;
        dBtn.onclick = function () {
            orderID=0;
            beginRecord = true;


           
        }
        stage.onTick(function () {         
            if (beginRecord && canRecord) {
         
                frameCount++
                if (frameCount > 60) {
                    beginRecord = false;
                    canRecord = false;
                    frameCount = 0;
                }
                currentTime = new Date();           
                    preTime = currentTime;
                    var canvas = document.createElement('canvas');
                    canvas.width = 100;
                    canvas.height = 100;
                    var ctx = canvas.getContext('2d');
                    ctx.drawImage(stage.canvas, ps.emitX - 50, ps.emitY - 50, 100, 100, 0, 0, 100, 100);
                    if (canvas.toBlob) {
                        canvas.toBlob(function (blob) {
                            PE.Util.downloadBlob(blob, orderID + ".png");
                            orderID++;
                        }, 'image/png'
                        );
                    }
                }           
        })
    }



})();
